import React, { useEffect, useState } from 'react'
import { fetchSunBurstFromAPI } from '../../../api/StaticData'
import SunBurst from '../../charts/SunBurst'

const StaticSunBurstChart = ({ onDataReceived, onWordDataReceived }) => {
  const [sunBurstData, setSunBurstData] = useState([])
  const [dataLoaded, setDataLoaded] = useState(false)

  useEffect(() => {
    const fetchSunBurst = async () => {
      try {
        const fetchSunBurstData = await fetchSunBurstFromAPI()
        setSunBurstData(fetchSunBurstData)
        setDataLoaded(true)
      } catch (error) {
        console.error('Failed to fetch sunburst data:', error)
      }
    }
    fetchSunBurst().catch(console.error)
  }, [])

  return (
    dataLoaded && (
      <SunBurst
        data={sunBurstData}
        onDataReceived={onDataReceived}
        onWordDataReceived={onWordDataReceived}
      />
    )
  )
}

export default StaticSunBurstChart
